import json
from typing import List, Dict, Any

def process_raw_data(raw_data: bytes) -> List[Dict[str, Any]]:
    result = []
    for raw in raw_data:
        try:
            decoded = raw.decode('')
            json_obj = json.loads(decoded)
            result.append(json_obj)
        except (UnicodeDecodeError, json.JSONDecodeError):
            result.append(None)
    return result
